//Setting up the default values of the variables so that when a kit a inserted, by default it should have height of 350. 
//(350 is the minimum height possible for width 1000)
kit_width_toa(1000) ->SOFT.device_type_mccb('T5');
kit_width_toa(1000) ->SOFT.installation_type('Vertical');
kit_width_toa(1000) ->SOFT.number_of_poles(3);
kit_width_toa(1000) ->SOFT.device_version('W');
kit_width_toa(1000) ->SOFT.accessory('Toggle');
kit_width_toa(1000) ->SOFT.number_of_breakers(3);
kit_width_toa(1000) ->SOFT.kit_height_breaker(350);
